import Header from "./Header";

const Layout = (props) => (
  <div className="indiana-background h-100">
    <Head>
      <title>Indiana General Assembly, 2020 Session</title>
      <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css" integrity="sha384-JcKb8q3iqJ61gNV9KGb8thSsNjpSL0n8PARn9HuZOnIxN0hoP+VmmDGMN5t9UJ0Z" crossOrigin="anonymous" />
    </Head>
    <div className="indiana-background-border mx-5 d-flex flex-column justify-content-start">
      <Header/>
      {props.children}
    </div>

    <style jsx global>{`
      html, body {
        height: 100%;
      }
      #__next {
        height: 100%;
      }
      .indiana-background {
        background-color: rgb(5, 24, 54);
      }
      .indiana-background-border {
        border-right: 5px solid #ffd54a;
        border-left: 5px solid #ffd54a;
      }
     `}</style>
  </div>


);

export default Layout;
